    extensions: ['SErviNGSliCes', 'Cheese', 'StuFfed'] then you should
    return 'Slices.SErviNGSliCes' since 'SErviNGSliCes' is the strongest extension 
    (its strength is -1).
    Example:
    for Strongest_Extension('my_class', ['AA', 'Be', 'CC']) == 'my_class.AA'
    """
    extensions_dict = {}
    extensions_dict['AA'] = extensions[0]
    extensions_dict['Be'] = extensions[1]
    extensions_dict['CC'] = extensions[2]
    extensions_dict_sorted = sorted(extensions_dict.items(), key=lambda x: x[1][::-1])
